component.schema:
{
 "description": "SSP is the Schema for the ssps API",
 "properties": {
  "spec": {
   "description": "SSPSpec defines the desired state of SSP",
   "properties": {
    "commonInstancetypes": {
     "description": "CommonInstancetypes is ignored.\nDeprecated: This field is ignored.",
     "properties": {
      "url": {
       "description": "URL of a remote Kustomize target from which to generate and deploy resources.\n\nThe following caveats apply to the provided URL:\n\n* Only 'https://' and 'git://' URLs are supported.\n\n* The URL must include '?ref=$ref' or '?version=$ref' pinning it to a specific\n  reference. It is recommended that the reference be a specific commit or tag\n  to ensure the generated contents does not change over time. As such it is\n  recommended not to use branches as the ref for the time being.\n\n* Only VirtualMachineClusterPreference and VirtualMachineClusterInstancetype\n  resources generated from the URL are deployed by the operand.\n\nSee the following Kustomize documentation for more details:\n\nremote targets\nhttps://github.com/kubernetes-sigs/kustomize/blob/master/examples/remoteBuild.md",
       "type": "string"
      }
     },
     "type": "object"
    },
    "commonTemplates": {
     "description": "CommonTemplates is the configuration of the common templates operand",
     "properties": {
      "dataImportCronTemplates": {
       "description": "DataImportCronTemplates defines a list of DataImportCrons managed by the SSP\nOperator. This is intended for images used by CommonTemplates.",
       "items": {
        "description": "DataImportCronTemplate defines the template type for DataImportCrons.\nIt requires metadata.name to be specified while leaving namespace as optional.",
        "properties": {
         "metadata": {
          "properties": {
           "annotations": {
            "additionalProperties": {
             "type": "string"
            },
            "type": "object"
           },
           "finalizers": {
            "items": {
             "type": "string"
            },
            "type": "array"
           },
           "labels": {
            "additionalProperties": {
             "type": "string"
            },
            "type": "object"
           },
           "name": {
            "type": "string"
           },
           "namespace": {
            "type": "string"
           }
          },
          "type": "object"
         },
         "spec": {
          "description": "DataImportCronSpec defines specification for DataImportCron",
          "properties": {
           "garbageCollect": {
            "description": "GarbageCollect specifies whether old PVCs should be cleaned up after a new PVC is imported.\nOptions are currently \"Outdated\" and \"Never\", defaults to \"Outdated\".",
            "type": "string"
           },
           "importsToKeep": {
            "description": "Number of import PVCs to keep when garbage collecting. Default is 3.",
            "format": "int32",
            "type": "integer"
           },
           "managedDataSource": {
            "description": "ManagedDataSource specifies the name of the corresponding DataSource this cron will manage.\nDataSource has to be in the same namespace.",
            "type": "string"
           },
           "retentionPolicy": {
            "description": "RetentionPolicy specifies whether the created DataVolumes and DataSources are retained when their DataImportCron is deleted. Default is RatainAll.",
            "type": "string"
           },
           "schedule": {
            "description": "Schedule specifies in cron format when and how often to look for new imports",
            "type": "string"
           },
           "template": {
            "description": "Template specifies template for the DVs to be created",
            "properties": {
             "apiVersion": {
              "description": "APIVersion defines the versioned schema of this representation of an object.\nServers should convert recognized schemas to the latest internal value, and\nmay reject unrecognized values.\nMore info: https://git.k8s.io/community/contributors/devel/sig-architecture/api-conventions.md#resources",
              "type": "string"
             },
             "kind": {
              "description": "Kind is a string value representing the REST resource this object represents.\nServers may infer this from the endpoint the client submits requests to.\nCannot be updated.\nIn CamelCase.\nMore info: https://git.k8s.io/community/contributors/devel/sig-architecture/api-conventions.md#types-kinds",
              "type": "string"
             },
             "metadata": {
              "properties": {
               "annotations": {
                "additionalProperties": {
                 "type": "string"
                },
                "type": "object"
               },
               "finalizers": {
                "items": {
                 "type": "string"
                },
                "type": "array"
               },
               "labels": {
                "additionalProperties": {
                 "type": "string"
                },
                "type": "object"
               },
               "name": {
                "type": "string"
               },
               "namespace": {
                "type": "string"
               }
              },
              "type": "object"
             },
             "spec": {
              "description": "DataVolumeSpec defines the DataVolume type specification",
              "properties": {
               "checkpoints": {
                "description": "Checkpoints is a list of DataVolumeCheckpoints, representing stages in a multistage import.",
                "items": {
                 "description": "DataVolumeCheckpoint defines a stage in a warm migration.",
                 "properties": {
                  "current": {
                   "description": "Current is the identifier of the snapshot created for this checkpoint.",
                   "type": "string"
                  },
                  "previous": {
                   "description": "Previous is the identifier of the snapshot from the previous checkpoint.",
                   "type": "string"
                  }
                 },
                 "required": [
                  "current",
                  "previous"
                 ],
                 "type": "object"
                },
                "type": "array"
               },
               "contentType": {
                "description": "DataVolumeContentType options: \"kubevirt\", \"archive\"",
                "enum": [
                 "kubevirt",
                 "archive"
                ],
                "type": "string"
               },
               "finalCheckpoint": {
                "description": "FinalCheckpoint indicates whether the current DataVolumeCheckpoint is the final checkpoint.",
                "type": "boolean"
               },
               "preallocation": {
                "description": "Preallocation controls whether storage for DataVolumes should be allocated in advance.",
                "type": "boolean"
               },
               "priorityClassName": {
                "description": "PriorityClassName for Importer, Cloner and Uploader pod",
                "type": "string"
               },
               "pvc": {
                "description": "PVC is the PVC specification",
                "properties": {
                 "accessModes": {
                  "description": "accessModes contains the desired access modes the volume should have.\nMore info: https://kubernetes.io/docs/concepts/storage/persistent-volumes#access-modes-1",
                  "items": {
                   "type": "string"
                  },
                  "type": "array",
                  "x-kubernetes-list-type": "atomic"
                 },
                 "dataSource": {
                  "description": "dataSource field can be used to specify either:\n* An existing VolumeSnapshot object (snapshot.storage.k8s.io/VolumeSnapshot)\n* An existing PVC (PersistentVolumeClaim)\nIf the provisioner or an external controller can support the specified data source,\nit will create a new volume based on the contents of the specified data source.\nWhen the AnyVolumeDataSource feature gate is enabled, dataSource contents will be copied to dataSourceRef,\nand dataSourceRef contents will be copied to dataSource when dataSourceRef.namespace is not specified.\nIf the namespace is specified, then dataSourceRef will not be copied to dataSource.",
                  "properties": {
                   "apiGroup": {
                    "description": "APIGroup is the group for the resource being referenced.\nIf APIGroup is not specified, the specified Kind must be in the core API group.\nFor any other third-party types, APIGroup is required.",
                    "type": "string"
                   },
                   "kind": {
                    "description": "Kind is the type of resource being referenced",
                    "type": "string"
                   },
                   "name": {
                    "description": "Name is the name of resource being referenced",
                    "type": "string"
                   }
                  },
                  "required": [
                   "kind",
                   "name"
                  ],
                  "type": "object",
                  "x-kubernetes-map-type": "atomic"
                 },
                 "dataSourceRef": {
                  "description": "dataSourceRef specifies the object from which to populate the volume with data, if a non-empty\nvolume is desired. This may be any object from a non-empty API group (non\ncore object) or a PersistentVolumeClaim object.\nWhen this field is specified, volume binding will only succeed if the type of\nthe specified object matches some installed volume populator or dynamic\nprovisioner.\nThis field will replace the functionality of the dataSource field and as such\nif both fields are non-empty, they must have the same value. For backwards\ncompatibility, when namespace isn't specified in dataSourceRef,\nboth fields (dataSource and dataSourceRef) will be set to the same\nvalue automatically if one of them is empty and the other is non-empty.\nWhen namespace is specified in dataSourceRef,\ndataSource isn't set to the same value and must be empty.\nThere are three important differences between dataSource and dataSourceRef:\n* While dataSource only allows two specific types of objects, dataSourceRef\n  allows any non-core object, as well as PersistentVolumeClaim objects.\n* While dataSource ignores disallowed values (dropping them), dataSourceRef\n  preserves all values, and generates an error if a disallowed value is\n  specified.\n* While dataSource only allows local objects, dataSourceRef allows objects\n  in any namespaces.\n(Beta) Using this field requires the AnyVolumeDataSource feature gate to be enabled.\n(Alpha) Using the namespace field of dataSourceRef requires the CrossNamespaceVolumeDataSource feature gate to be enabled.",
                  "properties": {
                   "apiGroup": {
                    "description": "APIGroup is the group for the resource being referenced.\nIf APIGroup is not specified, the specified Kind must be in the core API group.\nFor any other third-party types, APIGroup is required.",
                    "type": "string"
                   },
                   "kind": {
                    "description": "Kind is the type of resource being referenced",
                    "type": "string"
                   },
                   "name": {
                    "description": "Name is the name of resource being referenced",
                    "type": "string"
                   },
                   "namespace": {
                    "description": "Namespace is the namespace of resource being referenced\nNote that when a namespace is specified, a gateway.networking.k8s.io/ReferenceGrant object is required in the referent namespace to allow that namespace's owner to accept the reference. See the ReferenceGrant documentation for details.\n(Alpha) This field requires the CrossNamespaceVolumeDataSource feature gate to be enabled.",
                    "type": "string"
                   }
                  },
                  "required": [
                   "kind",
                   "name"
                  ],
                  "type": "object"
                 },
                 "resources": {
                  "description": "resources represents the minimum resources the volume should have.\nIf RecoverVolumeExpansionFailure feature is enabled users are allowed to specify resource requirements\nthat are lower than previous value but must still be higher than capacity recorded in the\nstatus field of the claim.\nMore info: https://kubernetes.io/docs/concepts/storage/persistent-volumes#resources",
                  "properties": {
                   "limits": {
                    "additionalProperties": {
                     "anyOf": [
                      {
                       "type": "integer"
                      },
                      {
                       "type": "string"
                      }
                     ],
                     "pattern": "^(\\+|-)?(([0-9]+(\\.[0-9]*)?)|(\\.[0-9]+))(([KMGTPE]i)|[numkMGTPE]|([eE](\\+|-)?(([0-9]+(\\.[0-9]*)?)|(\\.[0-9]+))))?$",
                     "x-kubernetes-int-or-string": true
                    },
                    "description": "Limits describes the maximum amount of compute resources allowed.\nMore info: https://kubernetes.io/docs/concepts/configuration/manage-resources-containers/",
                    "type": "object"
                   },
                   "requests": {
                    "additionalProperties": {
                     "anyOf": [
                      {
                       "type": "integer"
                      },
                      {
                       "type": "string"
                      }
                     ],
                     "pattern": "^(\\+|-)?(([0-9]+(\\.[0-9]*)?)|(\\.[0-9]+))(([KMGTPE]i)|[numkMGTPE]|([eE](\\+|-)?(([0-9]+(\\.[0-9]*)?)|(\\.[0-9]+))))?$",
                     "x-kubernetes-int-or-string": true
                    },
                    "description": "Requests describes the minimum amount of compute resources required.\nIf Requests is omitted for a container, it defaults to Limits if that is explicitly specified,\notherwise to an implementation-defined value. Requests cannot exceed Limits.\nMore info: https://kubernetes.io/docs/concepts/configuration/manage-resources-containers/",
                    "type": "object"
                   }
                  },
                  "type": "object"
                 },
                 "selector": {
                  "description": "selector is a label query over volumes to consider for binding.",
                  "properties": {
                   "matchExpressions": {
                    "description": "matchExpressions is a list of label selector requirements. The requirements are ANDed.",
                    "items": {
                     "description": "A label selector requirement is a selector that contains values, a key, and an operator that\nrelates the key and values.",
                     "properties": {
                      "key": {
                       "description": "key is the label key that the selector applies to.",
                       "type": "string"
                      },
                      "operator": {
                       "description": "operator represents a key's relationship to a set of values.\nValid operators are In, NotIn, Exists and DoesNotExist.",
                       "type": "string"
                      },
                      "values": {
                       "description": "values is an array of string values. If the operator is In or NotIn,\nthe values array must be non-empty. If the operator is Exists or DoesNotExist,\nthe values array must be empty. This array is replaced during a strategic\nmerge patch.",
                       "items": {
                        "type": "string"
                       },
                       "type": "array",
                       "x-kubernetes-list-type": "atomic"
                      }
                     },
                     "required": [
                      "key",
                      "operator"
                     ],
                     "type": "object"
                    },
                    "type": "array",
                    "x-kubernetes-list-type": "atomic"
                   },
                   "matchLabels": {
                    "additionalProperties": {
                     "type": "string"
                    },
                    "description": "matchLabels is a map of {key,value} pairs. A single {key,value} in the matchLabels\nmap is equivalent to an element of matchExpressions, whose key field is \"key\", the\noperator is \"In\", and the values array contains only \"value\". The requirements are ANDed.",
                    "type": "object"
                   }
                  },
                  "type": "object",
                  "x-kubernetes-map-type": "atomic"
                 },
                 "storageClassName": {
                  "description": "storageClassName is the name of the StorageClass required by the claim.\nMore info: https://kubernetes.io/docs/concepts/storage/persistent-volumes#class-1",
                  "type": "string"
                 },
                 "volumeAttributesClassName": {
                  "description": "volumeAttributesClassName may be used to set the VolumeAttributesClass used by this claim.\nIf specified, the CSI driver will create or update the volume with the attributes defined\nin the corresponding VolumeAttributesClass. This has a different purpose than storageClassName,\nit can be changed after the claim is created. An empty string value means that no VolumeAttributesClass\nwill be applied to the claim but it's not allowed to reset this field to empty string once it is set.\nIf unspecified and the PersistentVolumeClaim is unbound, the default VolumeAttributesClass\nwill be set by the persistentvolume controller if it exists.\nIf the resource referred to by volumeAttributesClass does not exist, this PersistentVolumeClaim will be\nset to a Pending state, as reflected by the modifyVolumeStatus field, until such as a resource\nexists.\nMore info: https://kubernetes.io/docs/concepts/storage/volume-attributes-classes/\n(Beta) Using this field requires the VolumeAttributesClass feature gate to be enabled (off by default).",
                  "type": "string"
                 },
                 "volumeMode": {
                  "description": "volumeMode defines what type of volume is required by the claim.\nValue of Filesystem is implied when not included in claim spec.",
                  "type": "string"
                 },
                 "volumeName": {
                  "description": "volumeName is the binding reference to the PersistentVolume backing this claim.",
                  "type": "string"
                 }
                },
                "type": "object"
               },
               "source": {
                "description": "Source is the src of the data for the requested DataVolume",
                "properties": {
                 "blank": {
                  "description": "DataVolumeBlankImage provides the parameters to create a new raw blank image for the PVC",
                  "type": "object"
                 },
                 "gcs": {
                  "description": "DataVolumeSourceGCS provides the parameters to create a Data Volume from an GCS source",
                  "properties": {
                   "secretRef": {
                    "description": "SecretRef provides the secret reference needed to access the GCS source",
                    "type": "string"
                   },
                   "url": {
                    "description": "URL is the url of the GCS source",
                    "type": "string"
                   }
                  },
                  "required": [
                   "url"
                  ],
                  "type": "object"
                 },
                 "http": {
                  "description": "DataVolumeSourceHTTP can be either an http or https endpoint, with an optional basic auth user name and password, and an optional configmap containing additional CAs",
                  "properties": {
                   "certConfigMap": {
                    "description": "CertConfigMap is a configmap reference, containing a Certificate Authority(CA) public key, and a base64 encoded pem certificate",
                    "type": "string"
                   },
                   "extraHeaders": {
                    "description": "ExtraHeaders is a list of strings containing extra headers to include with HTTP transfer requests",
                    "items": {
                     "type": "string"
                    },
                    "type": "array"
                   },
                   "secretExtraHeaders": {
                    "description": "SecretExtraHeaders is a list of Secret references, each containing an extra HTTP header that may include sensitive information",
                    "items": {
                     "type": "string"
                    },
                    "type": "array"
                   },
                   "secretRef": {
                    "description": "SecretRef A Secret reference, the secret should contain accessKeyId (user name) base64 encoded, and secretKey (password) also base64 encoded",
                    "type": "string"
                   },
                   "url": {
                    "description": "URL is the URL of the http(s) endpoint",
                    "type": "string"
                   }
                  },
                  "required": [
                   "url"
                  ],
                  "type": "object"
                 },
                 "imageio": {
                  "description": "DataVolumeSourceImageIO provides the parameters to create a Data Volume from an imageio source",
                  "properties": {
                   "certConfigMap": {
                    "description": "CertConfigMap provides a reference to the CA cert",
                    "type": "string"
                   },
                   "diskId": {
                    "description": "DiskID provides id of a disk to be imported",
                    "type": "string"
                   },
                   "secretRef": {
                    "description": "SecretRef provides the secret reference needed to access the ovirt-engine",
                    "type": "string"
                   },
                   "url": {
                    "description": "URL is the URL of the ovirt-engine",
                    "type": "string"
                   }
                  },
                  "required": [
                   "diskId",
                   "url"
                  ],
                  "type": "object"
                 },
                 "pvc": {
                  "description": "DataVolumeSourcePVC provides the parameters to create a Data Volume from an existing PVC",
                  "properties": {
                   "name": {
                    "description": "The name of the source PVC",
                    "type": "string"
                   },
                   "namespace": {
                    "description": "The namespace of the source PVC",
                    "type": "string"
                   }
                  },
                  "required": [
                   "name",
                   "namespace"
                  ],
                  "type": "object"
                 },
                 "registry": {
                  "description": "DataVolumeSourceRegistry provides the parameters to create a Data Volume from an registry source",
                  "properties": {
                   "certConfigMap": {
                    "description": "CertConfigMap provides a reference to the Registry certs",
                    "type": "string"
                   },
                   "imageStream": {
                    "description": "ImageStream is the name of image stream for import",
                    "type": "string"
                   },
                   "pullMethod": {
                    "description": "PullMethod can be either \"pod\" (default import), or \"node\" (node docker cache based import)",
                    "type": "string"
                   },
                   "secretRef": {
                    "description": "SecretRef provides the secret reference needed to access the Registry source",
                    "type": "string"
                   },
                   "url": {
                    "description": "URL is the url of the registry source (starting with the scheme: docker, oci-archive)",
                    "type": "string"
                   }
                  },
                  "type": "object"
                 },
                 "s3": {
                  "description": "DataVolumeSourceS3 provides the parameters to create a Data Volume from an S3 source",
                  "properties": {
                   "certConfigMap": {
                    "description": "CertConfigMap is a configmap reference, containing a Certificate Authority(CA) public key, and a base64 encoded pem certificate",
                    "type": "string"
                   },
                   "secretRef": {
                    "description": "SecretRef provides the secret reference needed to access the S3 source",
                    "type": "string"
                   },
                   "url": {
                    "description": "URL is the url of the S3 source",
                    "type": "string"
                   }
                  },
                  "required": [
                   "url"
                  ],
                  "type": "object"
                 },
                 "snapshot": {
                  "description": "DataVolumeSourceSnapshot provides the parameters to create a Data Volume from an existing VolumeSnapshot",
                  "properties": {
                   "name": {
                    "description": "The name of the source VolumeSnapshot",
                    "type": "string"
                   },
                   "namespace": {
                    "description": "The namespace of the source VolumeSnapshot",
                    "type": "string"
                   }
                  },
                  "required": [
                   "name",
                   "namespace"
                  ],
                  "type": "object"
                 },
                 "upload": {
                  "description": "DataVolumeSourceUpload provides the parameters to create a Data Volume by uploading the source",
                  "type": "object"
                 },
                 "vddk": {
                  "description": "DataVolumeSourceVDDK provides the parameters to create a Data Volume from a Vmware source",
                  "properties": {
                   "backingFile": {
                    "description": "BackingFile is the path to the virtual hard disk to migrate from vCenter/ESXi",
                    "type": "string"
                   },
                   "initImageURL": {
                    "description": "InitImageURL is an optional URL to an image containing an extracted VDDK library, overrides v2v-vmware config map",
                    "type": "string"
                   },
                   "secretRef": {
                    "description": "SecretRef provides a reference to a secret containing the username and password needed to access the vCenter or ESXi host",
                    "type": "string"
                   },
                   "thumbprint": {
                    "description": "Thumbprint is the certificate thumbprint of the vCenter or ESXi host",
                    "type": "string"
                   },
                   "url": {
                    "description": "URL is the URL of the vCenter or ESXi host with the VM to migrate",
                    "type": "string"
